import React from 'react';
import { TextField } from '@material-ui/core';

function DadosUsuario() {
    return (
        <form>
            <TextField
                id="email"
                label="Email"
                type="email"
            />
            <TextField
                id="password"
                label="Senha"
                type="password"
            />
        </form>
    )
}

export default DadosUsuario
